import React, { FC } from 'react';
import Header from '@components/Header';

interface Props {
    children?: any;
}

const index: FC<Props> = ({ children }) => {
    return (
        <div>
            <Header />
            <div>{children}</div>
        </div>
    );
};

export default index;
